import React from 'react';
import { connect } from 'react-redux';
import { checkInSelectedAssetStart } from "../../redux/asset/asset.actions";

import './custom-button.styles.scss';

const checkIn = ({state}) => {
    console.log(this)
};

const checkOut = () => {
    console.log("Checking Outa")
};

const submitting = () => {
    console.log("submitting")
};

const CustomButton = ({children, isCheckIn, isCheckOut, state, ...props}) => {
    return (
        <div>
            <button
                className={`${isCheckIn ? 'check-in' : isCheckOut ? 'check-out' : 'submit' }  custom-button`}
                onClick={isCheckIn ? checkIn : isCheckOut ? checkOut : submitting} 
            >
                {children}
            </button>
        </div>
    )
}

const mapStateToProps = (state) => ({
    state: state
});

const mapDispatchToProps = (dispatch) => ({
    getAssetDetails: () => { dispatch(checkInSelectedAssetStart('WT'))}
})

export default connect(mapStateToProps, mapDispatchToProps)(CustomButton);
